import React, { useEffect, useState } from "react";
import {
  MDBBtn,
  MDBContainer,
  MDBRow,
  MDBCol,
  MDBCard,
  MDBCardBody,
  MDBInput,
} from "mdb-react-ui-kit";
import "mdb-react-ui-kit/dist/css/mdb.min.css";
import { useFormik } from "formik";
import { useNavigate } from "react-router-dom";

import "./cssFiles/loginComponent.css";
import Header from "../Layout/Header";

function LoginPage() {
  const loginInitial = {
    usernameLogin: "",
    passwordLogin: "",
  };
  const {} = {
    
  };

  const [signUpFormData, setSignUpFormData] = useState({});

  const navigate = useNavigate();
  const [signup, setSignUp] = useState(true);
  return (
    <>
      <Header />
      {signup ? (
        <MDBContainer
          style={{
            fontFamily: "'Overpass', sans-serif",
            backgroundColor: "transparent",
            boxShadow: "none",
          }}
        >
          <MDBRow className="d-flex justify-content-center align-items-center h-100">
            <MDBCol col="12">
              <MDBCard
                className="text-white my-5 mx-auto"
                style={{
                  borderRadius: "1rem",
                  maxWidth: "400px",
                  backgroundColor: "#282f33",
                }}
              >
                <form
                  onSubmit={(event) => {
                    event.preventDefault();
                    console.log("on submit:", signUpFormData);
                  }}
                >
                  <MDBCardBody className="p-5 d-flex flex-column align-items-center mx-auto w-100">
                    <h4>WELCOME TO</h4>
                    <h2 className="fw-bold mb-2 text-uppercase">ReactBites</h2>

                    <p className="text-white-50 mb-5">
                      Login for a seamless experience
                    </p>

                    <MDBInput
                      wrapperClass="mb-4 mx-5 w-100"
                      labelClass="text-white"
                      label="Enter username"
                      name="username"
                      id="username"
                      type="text"
                      size="lg"
                      value={signUpFormData.username}
                      onChange={(event) => {
                        const usernameValue = event.target.value;
                        setSignUpFormData({
                          ...signUpFormData,
                          username: usernameValue,
                        });
                      }}
                      style={{ color: "white" }}
                    />
                    <MDBInput
                      wrapperClass="mb-4 mx-5 w-100"
                      labelClass="text-white"
                      label="Enter name"
                      name="name"
                      id="name"
                      type="text"
                      size="lg"
                      value={signUpFormData.name}
                      onChange={(event) => {
                        const nameValue = event.target.value;
                        setSignUpFormData({
                          ...signUpFormData,
                          name: nameValue,
                        });
                      }}
                      style={{ color: "white" }}
                    />
                    <MDBInput
                      wrapperClass="mb-4 mx-5 w-100"
                      labelClass="text-white"
                      label="Enter Email"
                      name="email"
                      id="email"
                      type="email"
                      size="lg"
                      value={signUpFormData.email}
                      onChange={(event) => {
                        const emailValue = event.target.value;
                        setSignUpFormData({
                          ...signUpFormData,
                          email: emailValue,
                        });
                      }}
                      style={{ color: "white" }}
                    />
                    <MDBInput
                      wrapperClass="mb-4 mx-5 w-100"
                      labelClass="text-white"
                      label="Password?"
                      id="password"
                      name="password"
                      type="password"
                      size="lg"
                      value={signUpFormData.password}
                      onChange={(event) => {
                        const passwordValue = event.target.value;
                        setSignUpFormData({
                          ...signUpFormData,
                          password: passwordValue,
                        });
                      }}
                      style={{ color: "white" }}
                    />
                    <MDBInput
                      wrapperClass="mb-4 mx-5 w-100"
                      labelClass="text-white"
                      label="Confirm Passoword?"
                      id="confirmpassword"
                      name="confirmpassword"
                      type="password"
                      size="lg"
                      value={signUpFormData.confirmpassword}
                      onChange={(event) => {
                        const confirmpasswordValue = event.target.value;
                        setSignUpFormData({
                          ...signUpFormData,
                          confirmpassword: confirmpasswordValue,
                        });
                      }}
                      style={{ color: "white" }}
                    />

                    <MDBBtn
                      outline
                      className="mt-2 mx-2 px-5"
                      color="white"
                      size="lg"
                      type="submit"
                      onClick={() => {
                        console.log("button clicked");
                      }}
                    >
                      SignUp
                    </MDBBtn>

                    <div>
                      <p className="mb-0 mt-4">
                        Already have an account?{" "}
                        <span
                          className="text-white-50 fw-bold"
                          style={{ cursor: "pointer" }}
                        >
                          Login
                        </span>
                      </p>
                    </div>
                  </MDBCardBody>
                </form>
              </MDBCard>
            </MDBCol>
          </MDBRow>
        </MDBContainer>
      ) : (
        // </form>
        //log in
        // <form onSubmit={formik.handleSubmit}>
        // <MDBContainer
        //   style={{
        //     fontFamily: "'Overpass', sans-serif",
        //     backgroundColor: "transparent",
        //     boxShadow: "none",
        //   }}
        // >
        //   <MDBRow className="d-flex justify-content-center align-items-center h-100">
        //     <MDBCol col="12">
        //       <MDBCard
        //         className="text-white my-5 mx-auto"
        //         style={{
        //           borderRadius: "1rem",
        //           maxWidth: "400px",
        //           backgroundColor: "#282f33",
        //         }}
        //       >
        //         <MDBCardBody className="p-5 d-flex flex-column align-items-center mx-auto w-100">
        //           <h4>WELCOME TO</h4>
        //           <h2 className="fw-bold mb-2 text-uppercase">ReactBites</h2>

        //           <p className="text-white-50 mb-5">
        //             Login for a seamless experience
        //           </p>

        //           <MDBInput
        //             wrapperClass="mb-4 mx-5 w-100"
        //             labelClass="text-white"
        //             label="Username"
        //             name="usernameLogin"
        //             id="usernameLogin"
        //             type="text"
        //             size="lg"
        //             value={signUpFormData.usernameLogin}
        //             onChange={()=>}
        //             style={{ color: "white" }}
        //           />
        //           <MDBInput
        //             wrapperClass="mb-4 mx-5 w-100"
        //             labelClass="text-white"
        //             label="Password"
        //             id="passswordLogin"
        //             name="passswordLogin"
        //             type="password"
        //             size="lg"
        //             value={formik.values.passswordLogin}
        //             onChange={formik.handleChange}
        //             style={{ color: "white" }}
        //           />

        //           <MDBBtn
        //             outline
        //             className="mt-2 mx-2 px-5"
        //             color="white"
        //             size="lg"
        //             type="submit"
        //             onClick={() => {
        //               navigate("/");
        //             }}
        //           >
        //             Login
        //           </MDBBtn>

        //           <div>
        //             <p className="mb-0 mt-4">
        //               Don't have an account?{" "}
        //               <span
        //                 className="text-white-50 fw-bold"
        //                 style={{ cursor: "pointer" }}
        //               >
        //                 Sign Up
        //               </span>
        //             </p>
        //           </div>
        //         </MDBCardBody>
        //       </MDBCard>
        //     </MDBCol>
        //   </MDBRow>
        // </MDBContainer>
        ""
      )}
      {/* </form> */}
    </>
  );
}

export default LoginPage;
